import { createContext } from "react";

const UserContext = createContext(undefined);
const UserConextDispatcher = createContext(undefined);

const userProvider = ({ children }) => {
    const [user, setUser] = useState({
        name: 'John Doe',
        email: 'john@gmail.com',
        age: 25
    });

    return (
        <UserContext.Provider value={user}>
            <UserConextDispatcher.Provider value={setUser}>
                {children}
            </UserConextDispatcher.Provider>
        </UserContext.Provider>
    )
}

export { UserContext, UserConextDispatcher, userProvider };
